import { Link, useLocation } from 'react-router-dom';
import './NavBar.scss'; // Asegúrate de que este archivo de SASS esté creado e importado

export default function NavBar({ navBarOptions }) {
  let location = useLocation();
  return (
    <nav className="navbar navbar-expand-lg sticky-top">
      <div className="container-fluid">
        <span className="navbar-brand"><strong>Portafolio</strong></span>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav mr-auto">
            {navBarOptions.map((navBarOption, index) => {
              let isActive = location.pathname === navBarOption.to ? 'active' : '';
              return (
                <li className="nav-item" key={index}>
                  <Link className={`nav-link ${isActive}`} to={navBarOption.to}>
                    {navBarOption.option}
                  </Link>
                </li>
              );
            })}
          </ul>
          <div className="navbar-icons">
            <a href="https://www.linkedin.com/in/elianamdb/"><i className="bi bi-linkedin"></i></a>
            <a href="https://github.com/ElianaRocio"><i className="bi bi-github"></i></a>
            <a href="https://wa.me/62423144"><i className="bi bi-whatsapp"></i></a>
          </div>
        </div>
      </div>
    </nav>
  );
}
